import React from "react";
import {
  LayoutDashboard,
  MessageSquare,
  CalendarDays,
  FileUp,
  ClipboardList,
  LogOut,
  Users,
  Settings,
  Video,
} from "lucide-react";
import { useNavigate, useLocation } from "react-router-dom";
import { AnimatePresence, motion } from "framer-motion";
import { authService } from "../services/authService";

interface SidebarProps {
  isOpen: boolean;
  onClose: () => void;
}

const Sidebar: React.FC<SidebarProps> = ({ isOpen, onClose }) => {
  const navigate = useNavigate();
  const location = useLocation();

  const navItems = [
    { label: "Dashboard", icon: LayoutDashboard, path: "/dashboard", color: "text-indigo-500" },
    { label: "Messages", icon: MessageSquare, path: "/messages", color: "text-blue-500" },
    { label: "Tasks", icon: ClipboardList, path: "/tasks", color: "text-rose-500" },
    { label: "Meetings", icon: Video, path: "/meetings", color: "text-emerald-500" },
    { label: "Calendar", icon: CalendarDays, path: "/calendar", color: "text-amber-500" },
    { label: "Files", icon: FileUp, path: "/files", color: "text-violet-500" },
    { label: "Team", icon: Users, path: "/team", color: "text-pink-500" },
    { label: "Settings", icon: Settings, path: "/settings", color: "text-slate-400" },
  ];

  return (
    <>
      <AnimatePresence>
        {isOpen && (
          <motion.div
            initial={{ opacity: 0 }}
            animate={{ opacity: 1 }}
            exit={{ opacity: 0 }}
            className="fixed inset-0 bg-slate-900/40 backdrop-blur-sm z-40 lg:hidden"
            onClick={onClose}
          />
        )}
      </AnimatePresence>

      <aside
        className={`fixed top-0 left-0 z-50 h-screen w-72 bg-white border-r border-slate-100 transform transition-transform duration-500 cubic-bezier(0.4, 0, 0.2, 1) ${isOpen ? "translate-x-0" : "-translate-x-full"
          } lg:translate-x-0 flex flex-col shadow-xl shadow-slate-200/20`}
      >
        {/* Brand Section */}
        <div
          className="p-8 pb-10 flex items-center gap-4 cursor-pointer group"
          onClick={() => navigate("/dashboard")}
        >
          <div className="w-10 h-10 bg-indigo-600 rounded-xl flex items-center justify-center shadow-lg shadow-indigo-100 group-hover:scale-105 transition-all duration-300">
            <img src="/logo1.png" alt="Logo" className="w-6 h-6 object-contain brightness-0 invert" />
          </div>
          <div>
            <h1 className="text-xl font-bold text-slate-900 tracking-tight leading-none mb-1">Collabryta</h1>
            <p className="text-[10px] font-semibold text-slate-400 uppercase tracking-widest">Unified Workspace</p>
          </div>
        </div>

        {/* Navigation */}
        <nav className="flex-1 px-4 space-y-1.5 overflow-y-auto custom-scrollbar">
          {navItems.map(({ label, icon: Icon, path, color }) => {
            const active = location.pathname.startsWith(path);
            return (
              <button
                key={path}
                onClick={() => {
                  navigate(path);
                  onClose();
                }}
                className={`w-full group flex items-center justify-between px-4 py-3 rounded-xl transition-all duration-200 ${active
                  ? "bg-indigo-50 text-indigo-700 font-semibold"
                  : "text-slate-500 hover:bg-slate-50 hover:text-slate-900"
                  }`}
              >
                <div className="flex items-center gap-3.5">
                  <Icon size={18} className={`${active ? "text-indigo-600" : color} transition-colors`} />
                  <span className="text-[14px]">{label}</span>
                </div>
                {active && (
                  <motion.div layoutId="activeDot" className="w-1 h-4 bg-indigo-600 rounded-full" />
                )}
              </button>
            );
          })}
        </nav>

        {/* Footer / Logout */}
        <div className="p-6 border-t border-slate-50 bg-slate-50/50">
          <button
            onClick={() => {
              authService.logout();
              navigate("/");
            }}
            className="w-full group flex items-center gap-3 px-4 py-3 rounded-xl text-[14px] font-medium text-slate-500 hover:bg-rose-50 hover:text-rose-600 transition-all duration-200 active:scale-95"
          >
            <LogOut size={18} />
            Sign Out
          </button>
        </div>
      </aside>
    </>
  );
};

export default Sidebar;
